PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE `cover` (
                         `id` INTEGER NOT NULL CONSTRAINT pk_cover PRIMARY KEY AUTOINCREMENT,
                         `jpeg` mediumblob NOT NULL
);
CREATE TABLE IF NOT EXISTS "artist"
(
    id INTEGER not null
        constraint pk_artist
            primary key autoincrement,
    name varchar(200) not null
);
CREATE TABLE IF NOT EXISTS "genre"
(
    id INTEGER not null
        constraint pk_genre
            primary key autoincrement,
    name varchar(200) not null
);
CREATE TABLE IF NOT EXISTS "song"
(
    id INTEGER not null
        constraint pk_album
            primary key autoincrement,
    name varchar(200) not null
);
CREATE TABLE IF NOT EXISTS "album"
(
    id INTEGER not null
        constraint pk_album
            primary key autoincrement,
    name char(200) not null,
    year int(11) not null,
    artistId int(11) not null
        references artist
            on delete cascade,
    genreId int(11) default NULL
        references genre
                   on delete set NULL,
    coverId int(11) default NULL
        references cover
                   on delete set NULL
);
CREATE TABLE IF NOT EXISTS "track"
(
    id INTEGER not null
        constraint pk_track
            primary key autoincrement,
    albumId int(11) not null
        constraint fk_album
            references album
            on delete cascade,
    songId int(11) not null
        constraint fk_song
            references song
            on delete cascade,
    diskNumber int(11) default 0,
    number int(11) not null,
    duration mediumint(11)
);
DELETE FROM sqlite_sequence;
CREATE INDEX idx_album_artist
    on album (artistId);
CREATE INDEX idx_album_cover
    on album (coverId);
CREATE INDEX idx_album_genre
    on album (genreId);
CREATE INDEX idx_track_album
    on track (albumId);
CREATE INDEX idx_track_diskNumber
    on track (diskNumber);
CREATE INDEX idx_track_number
    on track (number);
CREATE INDEX idx_track_song
    on track (songId);
COMMIT;
